import React from 'react';
import menu from './Utils/images/menu.png'


import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Navbar,  } from 'react-bootstrap';


function App() {
  return (
    <Navbar bg='light'>
      <Navbar.Brand>
        <Container>
        <button style={{border: 0}}>
        <img alt='' src={menu} width='46' height='46' className='d-inline-block align-top'/>{'  '}

        </button>
        Learn More

        </Container>
      </Navbar.Brand>

    </Navbar>
  );
}

export default App;
